        }

        map.createPane('pane_Refactored_0');

        var layer_Refactored_0 = new L.geoJson(json_Refactored_0, {

            interactive: true,

            pane: 'pane_Refactored_0',
            onEachFeature: pop_Refactored_0,
            style: style_Refactored_0_0,

        bounds_group.addLayer(layer_Refactored_0);

        var osmGeocoder = new L.Control.Geocoder({
